  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import logo from "../../src/logo.png";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import classNames from "classnames";

export default function Header() {
  return( 
    <div classNames="header">
      <div className="container-fluid nav-pc">
        <div className="container">
          <div className="nav-pc-top">
            <ul>
              <li><a></a></li>
              <li><i className="fas fa-sign-out-alt" />Đăng ký</li>
            </ul>

          </div>
          <div className="nav-pc-mid"></div>
          <div className="nav-pc-bot"></div>
        </div>
      </div>
    </div>

  );
}
